import React from 'react';

import './styles/NotFound.css';
import logo from '../images/astronauts.svg';

function NotFound(){
   return (
      <div className="error_container">
         <h1>404: Not Found</h1>
         <img src={logo} alt="astronautas"/>
      </div>
   );
}

export default NotFound;
